import React from 'react';
import {DAppProvider, ChainId} from "@usedapp/core";
import {Header} from "./components/header"
import {Container} from "@material-ui/core"

function App() {
  return (
    <DAppProvider config={{
      supportedChains:[ChainId.Kovan, ChainId.Rinkeby]
    }}>
        <div className="App">
          <Container>
            <div>Hi</div>
          </Container>
          <Header />
          </div>
      </DAppProvider>
  );
}

export default App;
